import { Container } from "react-bootstrap";
import HostForm from "./HostForm";
import HostDetails from "./HostDetails";

function Host() {
  const isHost = localStorage.getItem("isHost");
  return (
    <>
      <Container
        style={{
          marginTop: "2%",
        }}
      >
        {!isHost && <HostForm />}
        {isHost && <HostDetails />}
      </Container>
    </>
  );
}
export default Host;
